import React from 'react'
import classes from '../User/UserList.module'
const UserList = (props) =>{
  return (
    <ul>
      {
        props.items.map(list =>
          <li key={list.id}>
            {list.name} 
            ({list.age} years old)
           
          </li>)
      }
    </ul>
  )
}

export default UserList
